const initialState = {
  id: 'ssafy',
  password: 'ssafy',
}

const changeNickname = {
  type: 'CHANGE_NICKNAME',
  data: 'boogicho',
}

const auth = (state = initialState, action) => {
  switch (action.type) {
    case 'CHANGE_NICKNAME':
      return {
        ...state,
      }
  }
}

export default auth
